import React from "react"

export default function Sidebar(props) {

    const quizzesData = {
        "quizzes": [
            {
                "id": 0,
                "title": "This is my quiz",
                "questions": [
                    {
                        "question": "Why?",
                        "answers": [
                            "Cause yes", "Why not", "No", "Yes"
                        ],
                        "correctAnswer": "Yes"
                    }
                ]
            }
        ]
    }

    const things = quizzesData.quizzes.map(quiz => {
        return <div>{quiz.id}</div>
    })

    return (
        <div className="sidebar">
            <div>{quizzesData.quizzes[0].title}</div>
        </div>
    )
}
